import React from 'react';
import AccountDetails from './AccountDetails';
import AccountShowList from './AccountShowList';

const AccountShowPage = () => {
    return (
      <main>
        <AccountDetails
          username='francis'
          total_games={11}
          total_wins={8}
          total_kills={32}
        />
        <AccountShowList/>
      </main>
    )
  }

export default AccountShowPage;
